import React from "react";
import {CartProvider, useCart} from "react-use-cart";

function Cart(){
    const {addItem}=useCart();

    const startersProduct=[
       {
          id_first:1,
          name:"Crab Fish",
          price:3.800,
          quantity: 1
      },
          
        
      {
          id:2,
          name:"Kunafa Shrimp",
          price:3.000,
          quantity:1
      }
      
    ];
    return(
        <div>
           {startersProduct.filter((p) => (
            <div key={p.id}>
               
                <button onClick={() => addItem(p.id)}>Add to cart</button>
            </div>
      ))}
        </div>
    )
}
export default Cart;
